const catList = ["Freyja", "Tyrael", "Lucky", "Scarlett", "Bernouze"];

function ShoppingList() {
  return (
    <ul>
      {catList.map((cat) => (
        <li>{cat}</li>
      ))}
    </ul>
  );
}

export default ShoppingList;
